import React from "react";

// import { useEffect, useState } from "react";

export default function Robot(props) {
  const { id, robot, addToCart, cartItems } = props;

  return (
    <div className="card" id={id}>
      {cartItems}
      <figure>
        <img className="card-img" src="image" alt="robo" />
        <span className="card-category">{robot.material}</span>
        <span className="price">
          <b>$</b>
          "price"
        </span>
        <span className="card-item-in-stock">
          <b>In stock: </b>
          "stock"
        </span>
      </figure>
      <div className="card-info d-flex align-items-center justify-content-between">
        <div className="left">
          <p className="card-item-name">"name"</p>
          <span className="created-at">"createdAt"</span>
        </div>
        <div className="right">
          <button className="btn btn-primary" onClick={() => addToCart(robot)}>
            {/* <img
              src={CartIconPlus}
              height="20px"
              width="20px"
              alt="add-to-cart"
            /> */}
            add
          </button>
        </div>
      </div>
    </div>
  );
}
